    quantity integer NOT NULL,
    cart_id bigint NOT NULL,
    product_id bigint NOT NULL,
    CONSTRAINT users_cartitem_quantity_check CHECK ((quantity >= 0))
);


ALTER TABLE public.users_cartitem OWNER TO postgres;

--
-- Name: users_cartitem_id_seq; Type: SEQUENCE; Schema: public; Owner: postgres
--

ALTER TABLE public.users_cartitem ALTER COLUMN id ADD GENERATED BY DEFAULT AS IDENTITY (
    SEQUENCE NAME public.users_cartitem_id_seq
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1
);


--
-- Name: users_order; Type: TABLE; Schema: public; Owner: postgres
--

CREATE TABLE public.users_order (
    id bigint NOT NULL,
    fullname character varying(255) NOT NULL,
    phone character varying(255) NOT NULL,
    "Address" character varying(255) NOT NULL,
    payment_method character varying(255) NOT NULL,
    total_items integer NOT NULL,
    total_price double precision NOT NULL,
    status character varying(255) NOT NULL,
    date timestamp with time zone NOT NULL,
    cart_id bigint NOT NULL,
    updated_at timestamp with time zone NOT NULL,
    return_status character varying(255),
    CONSTRAINT users_order_total_items_check CHECK ((total_items >= 0))
);


ALTER TABLE public.users_order OWNER TO postgres;

--
-- Name: users_order_id_seq; Type: SEQUENCE; Schema: public; Owner: postgres
--

ALTER TABLE public.users_order ALTER COLUMN id ADD GENERATED BY DEFAULT AS IDENTITY (
    SEQUENCE NAME public.users_order_id_seq
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1
);


